import sys

from bitarray import bitarray

readline = sys.stdin.readline


def main():
    n = int(readline())
    a = [bitarray(readline().strip()) for _ in range(n)]
    ans = 0
    for i in range(n):
        for j in range(i + 1, n):
            if a[i][j]:
                ans += (a[i] & a[j]).count()

    print(ans // 3)


if __name__ == "__main__":
    main()
